import Button from './Button'

// Catch toggleAdd function prop from App.js
const Header = function( {toggleAdd} )
{
    return (
        <header className = 'header'>
            <h1> Task Tracker </h1>
            {/* Passing Props (color and text) into Button.js*/}
            <Button color = 'green'
                    onClick = {toggleAdd}
                    text = {toggleAdd ? 'Add' : 'Close'}          // Button writing will change, depending on toggleAdd function (from App.js)
            />
        </header>
    )
}

// What are you exposing to others that import this file?
export default Header
